r       more details.      stack-type       Specifies whether IPv6 is enabled on the interface. STACK_TYPE must       be one of: IPV4_ONLY, IPV4_IPV6, IPV6_ONLY. The default value is       IPV4_ONLY.      ipv6-network-tier       Specifies the IPv6 network tier that will be used to configure the       instance network interface IPv6 access config. IPV6_NETWORK_TIER       must be PREMIUM (currently only one value is supported).      internal-ipv6-address       Assigns the given internal IPv6 address or range to the instance       that is created. The address must be the first IP address in the       range or from a /96 IP address range. This option can be used only       when creating a single instance.      internal-ipv6-prefix-length       Optional field that indicates the prefix length of the internal       IPv6 address range. It should be used together with       internal-ipv6-address. Only /96 IP address range is supported and       the default value is 96. If not set, either the prefix length from       --internal-ipv6-address will be used or the default value of 96       will be assigned.      external-ipv6-address       Assigns the given external IPv6 address to the instance that is       created. The address must be the first IP address in the range.       This option can be used only when creating a single instance.      external-ipv6-prefix-length       The prefix length of the external IPv6 address range. This field       should be used together with external-ipv6-address. Only the /96 IP       address range is supported, and the default value is 96.      ipv6-public-ptr-domain       Assigns a custom PTR domain for the external IPv6 in the IPv6       access configuration of instance. If its value is not specified,       the default PTR record will be used. This option can only be       specified for the default network interface, nic0.      aliases       Specifies the IP alias ranges to allocate for this interface. If       there are multiple IP alias ranges, they are separated by       semicolons.       For example:         --aliases="10.128.1.0/24;range1:/32"       Each IP alias range consists of a range name and an IP range       separated by a colon, or just the IP range. The range name is the       name of the range within the network interface's subnet from which       to allocate an IP alias range. If unspecified, it defaults to the       primary IP range of the subnet. The IP range can be a CIDR range       (e.g. 192.168.100.0/24), a single IP address (e.g. 192.168.100.1),       or a netmask in CIDR format (e.g. /24). If the IP range is       specified by CIDR range or single IP address, it must belong to the       CIDR range specified by the range name on the subnet. If the IP       range is specified by netmask, the IP allocator will pick an       available range with the specified netmask and allocate it to this       network interface.      network-attachment       Specifies the network attachment that this interface should connect       to. Mutually exclusive with --network and --subnet flags.      vlan       VLAN ID of a Dynamic Network Interface, must be an integer in the       range from 2 to 255 inclusively.      igmp-query       Determines if the Compute Engine Instance can receive and respond       to IGMP query packets on the specified network interface.       IGMP_QUERY must be one of: IGMP_QUERY_V2, IGMP_QUERY_DISABLED. It       is disabled by default.
    /// </summary>
    [CliOption("--network-interface", Format = OptionFormat.EqualsSeparated, AllowMultiple = true)]
    public GcloudNetworkInterface? NetworkInterface { get; set; }

