    /// <summary>
    /// Zone of the instances to create. If not specified and the compute/zone     property isn't set, you might be prompted to select a zone (interactive     mode only).     To avoid prompting when this flag is omitted, you can set the     compute/zone property:       $ gcloud config set compute/zone ZONE     A list of zones can be fetched by running:       $ gcloud compute zones list     To unset the property, run:       $ gcloud config unset compute/zone     Alternatively, the zone can be stored in the environment variable     CLOUDSDK_COMPUTE_ZONE.    At most one of these can be specified:     --address=ADDRESS      Assigns the given external address to the instance that is created.      The address might be an IP address or the name or URI of an address      resource. This option can only be used when creating a single      instance.     --no-address      If provided, the instances are not assigned external IP addresses. To      pull container images, you must configure private Google access if      using Container Registry or configure Cloud NAT for instances to      access container images directly. For more information, see:      ▸ https://cloud.google.com/vpc/docs/configure-private-google-access      ▸ https://cloud.google.com/nat/docs/using-nat    Key resource - The Cloud KMS (Key Management Service) cryptokey that will   be used to protect the disk. The 'Compute Engine Service Agent' service   account must hold permission 'Cloud KMS CryptoKey Encrypter/Decrypter'.   The arguments in this group can be used to specify the attributes of this   resource.     --boot-disk-kms-key=BOOT_DISK_KMS_KEY      ID of the key or fully qualified identifier for the key.      To set the kms-key attribute:      ▸ provide the argument --boot-disk-kms-key on the command line.      This flag argument must be specified if any of the other arguments in      this group are specified.     --boot-disk-kms-keyring=BOOT_DISK_KMS_KEYRING      The KMS keyring of the key.      To set the kms-keyring attribute:      ▸ provide the argument --boot-disk-kms-key on the command line with       a fully specified name;      ▸ provide the argument --boot-disk-kms-keyring on the command line.     --boot-disk-kms-location=BOOT_DISK_KMS_LOCATION      The Google Cloud location for the key.      To set the kms-location attribute:      ▸ provide the argument --boot-disk-kms-key on the command line with       a fully specified name;      ▸ provide the argument --boot-disk-kms-location on the command       line.     --boot-disk-kms-project=BOOT_DISK_KMS_PROJECT      The Google Cloud project for the key.      To set the kms-project attribute:      ▸ provide the argument --boot-disk-kms-key on the command line with       a fully specified name;      ▸ provide the argument --boot-disk-kms-project on the command line;      ▸ set the property core/project.    At most one of these can be specified:     --confidential-compute      (DEPRECATED) The instance boots with Confidential Computing enabled.      Confidential Computing is based on Secure Encrypted Virtualization      (SEV), an AMD virtualization feature for running confidential      instances.      The --confidential-compute flag will soon be deprecated. Please use      --confidential-compute-type=SEV instead     --confidential-compute-type=CONFIDENTIAL_COMPUTE_TYPE      The instance boots with Confidential Computing enabled. Confidential      Computing can be based on Secure Encrypted Virtualization (SEV) or      Secure Encrypted Virtualization - Secure Nested Paging (SEV-SNP),      both of which are AMD virtualization features for running      confidential instances. Trust Domain eXtension based on Intel      virtualization features for running confidential instances is also      supported. CONFIDENTIAL_COMPUTE_TYPE must be one of:       SEV        Secure Encrypted Virtualization      SEV_SNP        Secure Encrypted Virtualization - Secure Nested Paging      TDX        Trust Domain eXtension    Custom machine type extensions.     --custom-cpu=CUSTOM_CPU      A whole number value specifying the number of cores that are needed      in the custom machine type.      For some machine types, shared-core values can also be used. For      example, for E2 machine types, you can specify micro, small, or      medium.      This flag argument must be specified if any of the other arguments in      this group are specified.     --custom-memory=CUSTOM_MEMORY      A whole number value indicating how much memory is desired in the      custom machine type. A size unit should be provided (eg. 3072MB or      9GB) - if no units are specified, GB is assumed.      This flag argument must be specified if any of the other arguments in      this group are specified.     --custom-extensions      Use the extended custom machine type.     --custom-vm-type=CUSTOM_VM_TYPE      Specifies a custom machine type. The default is n1. For more      information about custom machine types, see:      https://cloud.google.com/compute/docs/general-purpose-machines#custom_machine_types
    /// </summary>
    [CliOption("--zone", Format = OptionFormat.EqualsSeparated)]
