    /// <summary>
    /// The Google Cloud project against which all image and image family     references will be resolved. It is best practice to define     image-project. A full list of available projects can be generated by     running gcloud projects list.     ◆ If specifying one of our public images, image-project must be      provided.     ◆ If there are several of the same image-family value in multiple      projects, image-project must be specified to clarify the image to be      used.     ◆ If not specified and either image or image-family is provided, the      current default project is used.    At most one of these can be specified:     --image=IMAGE      Specifies the boot image for the instances. For each instance, a new      boot disk will be created from the given image. Each boot disk will      have the same name as the instance. To view a list of public images      and projects, run $ gcloud compute images list. It is best practice      to use --image when a specific version of an image is needed.      When using this option, --boot-disk-device-name and --boot-disk-size      can be used to override the boot disk's device name and size,      respectively.     --image-family=IMAGE_FAMILY      The image family for the operating system that the boot disk will be      initialized with. Compute Engine offers multiple Linux distributions,      some of which are available as both regular and Shielded VM images.      When a family is specified instead of an image, the latest      non-deprecated image associated with that family is used. It is best      practice to use --image-family when the latest version of an image is      needed.      By default, debian-12 is assumed for this flag.     --source-snapshot=SOURCE_SNAPSHOT      The name of the source disk snapshot that the instance boot disk will      be created from. You can provide this as a full URL to the snapshot      or just the snapshot name. For example, the following are valid      values:      ▸ https://compute.googleapis.com/compute/v1/projects/myproject/global/snapshots/snapshot      ▸ snapshot    Key resource - The Cloud KMS (Key Management Service) cryptokey that will   be used to protect the instance. The 'Compute Engine Service Agent'   service account must hold permission 'Cloud KMS CryptoKey   Encrypter/Decrypter'. The arguments in this group can be used to specify   the attributes of this resource.     --instance-kms-key=INSTANCE_KMS_KEY      ID of the key or fully qualified identifier for the key.      To set the kms-key attribute:      ▸ provide the argument --instance-kms-key on the command line.      This flag argument must be specified if any of the other arguments in      this group are specified.     --instance-kms-keyring=INSTANCE_KMS_KEYRING      The KMS keyring of the key.      To set the kms-keyring attribute:      ▸ provide the argument --instance-kms-key on the command line with       a fully specified name;      ▸ provide the argument --instance-kms-keyring on the command line.     --instance-kms-location=INSTANCE_KMS_LOCATION      The Google Cloud location for the key.      To set the kms-location attribute:      ▸ provide the argument --instance-kms-key on the command line with       a fully specified name;      ▸ provide the argument --instance-kms-location on the command line.     --instance-kms-project=INSTANCE_KMS_PROJECT      The Google Cloud project for the key.      To set the kms-project attribute:      ▸ provide the argument --instance-kms-key on the command line with       a fully specified name;      ▸ provide the argument --instance-kms-project on the command line;      ▸ set the property core/project.    Sole Tenancy.    At most one of these can be specified:     --node=NODE      The name of the node to schedule this instance on.     --node-affinity-file=PATH_TO_FILE      The JSON/YAML file containing the configuration of desired nodes onto      which this instance could be scheduled. These rules filter the nodes      according to their node affinity labels. A node's affinity labels      come from the node template of the group the node is in.      The file should contain a list of a JSON/YAML objects. For an      example, see      https://cloud.google.com/compute/docs/nodes/provisioning-sole-tenant-vms#configure_node_affinity_labels.      The following list describes the fields:       key        Corresponds to the node affinity label keys of the Node resource.      operator        Specifies the node selection type. Must be one of: IN: Requires        Compute Engine to seek for matched nodes. NOT_IN: Requires        Compute Engine to avoid certain nodes.      values        Optional. A list of values which correspond to the node affinity        label values of the Node resource.        Use a full or relative path to a local file containing the value        of node_affinity_file.     --node-group=NODE_GROUP      The name of the node group to schedule this instance on.    At most one of these can be specified:     --public-ptr      Creates a DNS PTR record for the external IP of the instance.     --no-public-ptr      If provided, no DNS PTR record is created for the external IP of the      instance. Mutually exclusive with public-ptr-domain.    At most one of these can be specified:     --public-ptr-domain=PUBLIC_PTR_DOMAIN      Assigns a custom PTR domain for the external IP of the instance.      Mutually exclusive with no-public-ptr.     --no-public-ptr-domain      If both this flag and --public-ptr are specified, creates a DNS PTR      record for the external IP of the instance with the PTR domain name      being the DNS name of the instance.    Specifies the reservation for the instance.     --reservation=RESERVATION      The name of the reservation, required when      --reservation-affinity=specific.     --reservation-affinity=RESERVATION_AFFINITY; default="any"      The type of reservation for the instance. RESERVATION_AFFINITY must      be one of:       any        Consume any available, matching